import react from "react"
import ProductCard from "../Components/Product-Card"
import {
    AllProducts
} from "./primaryDB"

export default function Products() {
    return (
        AllProducts.map((item) => {
            return (
                ProductCard(item.name)
                
            )
        })

    )


}
